import articleContent from "./ArticleContent";
function Article({ match }) {
    const name = match.params.name;
    const article = articleContent.find(article => article.name)

    return (
        <>
            <p>{article.title}</p>
            <h1>{name}</h1>
            {article.content.map((content, key) => (
                <p key={key}>{content}</p>
            ))}
        </>
    )

}

export default Article;
